import NavBar from "../NavBar";

function HomePage(){
    return (
        <div className="home">
            <NavBar/>
            {/* left side of screen  */}
            <div className="bg-[#393053] border-r-white h-[33%]">

            </div>

            {/* div containing image  */}
            <div className="img-con relative h-[300px] w-[255px] bg-[#18122B] left-[25%] top-[-19%]">

            </div>


            {/* right side of screen with content  */}
            <div className="h-[60%]">

            </div>
        </div>
    );
}

export default HomePage;
